import styled from "styled-components/macro";

const Wrapper = styled.div`
  .explore-container {
      height: 450px;
      background-color: #000;
      padding: 0 24px;

  }

  .explore-title {
    margin:0;
    padding: 50px 0 80px 0;
    color: #fff;
    font-size: 48px;
    font-family: 'Montserrat';
    font-style: normal;
  }

  .explore-content {
    // max-width: 1232px;
    margin: auto;
  }

  .explore-item {
    display: inline-block;
    vertical-align: top;
    width: 40%;
    height: 150px;
    margin: 4px;
  }

`;

export default Wrapper;
